import React from "react";
import AccordionItem from "./AccordionItem";
import '../../'

const Accordion = ({ data }) => {
  return (
    <div className="accordian">
      {data.map((faq, index) => (
        <AccordionItem title={faq.title} text={faq.text} num={index} />
      ))}
    </div>
  );
};

export default Accordion;
